import React from "react";
import "./Cards.css";
import Card from "./Card";
import { cardsData } from "../../../data/data";

const Cards = () => {
  return (
    <div className="Cards">
      {cardsData.map((card, id) => {
        return (
          <div className="parentContainer" key={id}>
            <Card
              title={card.title}
              color={card.color}
              barValue={card.barValue}
              value={card.value}
              series={card.series}
            />
          </div>
        );
      })}
    </div>
  );
};

export default Cards;
